import React, { Fragment } from 'react';
import { Jumbotron, Carousel} from "react-bootstrap";
import img1 from '../images/notesApp1.png';
import img2 from '../images/notesApp2.png';
import img3 from '../images/notesApp3.jpeg';




function WelcomePage(props) {
    return (
        <Fragment>

<Jumbotron>
  <h1>Ideas Becomes Notes !!!!!!</h1>
  <p>
    Here is your Notes....catch your ideas and place it in amazing notes..
  </p>

</Jumbotron>

}
<Carousel>
  <Carousel.Item>
    <img width={800} height={700} alt="image1" src={img1} align="center" />
    <Carousel.Caption>
      <h3>First slide Notes</h3>

    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img width={800} height={700} alt="image2" src={img2} align="center"/>
    <Carousel.Caption>
      <h3>Second slide Notes</h3>

    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img width={900} height={500} alt="image3" src={img3} align="center"/>
    <Carousel.Caption>
      <h3>Third slide Notes</h3>

    </Carousel.Caption>
  </Carousel.Item>
</Carousel>

        </Fragment>
    );


};



export default WelcomePage;
